export function getTextObj(text){
  let info = {}
    if (text) {
     
      info.textlength = text.length;
      info.text = text;
      info.textlength > 0  ? info.isNullorEmpty = false : info.isNullorEmpty = true;
  
    }     return info;
  }

  export function getMassChangeClass(mass, str, txtobj) {
   
    (txtobj) ?  mass = mass.filter(el => el !== str).push(str) :
     mass =  mass.filter(el => el !== str)
